def id2ss(ID):
    """Given a Synset ID (e.g. 01234567-n) return a synset"""
    return wn._synset_from_pos_and_offset(str(ID[-1:]), int(ID[:8]))

def scoreToAnswer(score):
    if score  > -1.0 and score < -0.6:
        return "no"
    elif score >= -0.6 and score < -0.2:
        return "unlikely"
    elif score >= -0.2 and score <0.2:
        return "maybe"
    elif score >= 0.2 and score <0.6:
        return "likely"
    elif score >= 0.6 and score < 1:
        return "yes"
    else:
        return "unknown"

def getPole(word):
    if word in POS:
        return "positive"
    elif word in NEG:
        return "negative"
    else:
        return "neutral"


def makeScoreDict(input, output):
    for feat in input:
        agreement = input[feat]["agreementScore"]
        freq = input[feat]["frequency"]
        output.update({feat: (agreement / freq)})


